{
	title: 'Example/PackagesOutdated',
	component: ObgPackagesOutdatedComponent,
	tags: ['autodocs'],
	parameters: {
		docs: {
			description: {
				component: `
This component has been created by [@punix81](https://github.com/punix81).

This component uses the "npm outdated" command to display the current status of your project's dependencies in table form. It informs you of available versions that may include bug fixes, performance enhancements or new features.

## Configuration
Add a script to run the "npm outdate" command in your  \`package.json\` file



\`\`\`json
"scripts": {
  "check-updates": "npm outdated --json > [YOUR_PATH]/outdated-report.json || true"
}
\`\`\`
`
			}
		}
	},
	decorators: [
		moduleMetadata({
			imports: [HttpClientModule, ObgPackagesOutdatedComponent, BrowserAnimationsModule, MatButtonModule, ObliqueModule],
			providers: [
				{
					provide: PackagesOutdatedService,
					useValue: {
						getOutdatedPackages: () => of(mockPackages),
						getLocalPackages: () => of(mockPackages) // Mock getLocalPackages method
					}
				}
			]
		})
	]
} as Meta

{
	title: 'Components/TextareaInput',
	component: TextareaInputComponent,
	tags: ['autodocs'],
	parameters: {
		docs: {
			description: {
				component: `
This component has been created by [@punix81](https://github.com/punix81).

The TextAreaCounter component is a handy tool for developers, displaying the number of characters remaining in a text area (textarea) in real time. Ideal for forms and text entries requiring character limits, it offers an enhanced user experience by providing immediate visual feedback.

`
			}
		}
	},
	decorators: [
		moduleMetadata({
			imports: [BrowserAnimationsModule, FormsModule, TextareaInputComponent, ReactiveFormsModule, MatFormFieldModule, MatInputModule]
		})
	],
